import React, { Component } from 'react';
import { Parallax } from 'react-parallax';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';


import './Home.css';
const image1 = "./imgs/frontPatio.jpg"
const image2 = "./imgs/diningRoom.jpg";
const image3 = "./imgs/lounge.jpg";
const image4 = "./imgs/terrace.jpg";
const image5 = "./imgs/theGrotto.jpg";



class HomePage extends Component {
    render() {
        return (
           <div className="homePage">
                {/* FRONT PAGE */}
                <Container className="container">
                    <Row>
                        <Col>

                        </Col>
                    </Row>
                </Container>


                {/* AREAS/PARALLAX SECTION */}
                <div> 
                <Parallax 
                    bgImage={image1} 
                    bgImageStyle={{
                        height:"800px",
                        width:"100%"
                        }} 
                    strength={500} 
                    >
                        <div className="parallaxSize">
                            <div className="inside">

                            </div>
                        </div>
               </Parallax>
               <Parallax 
                    bgImage={image2} 
                    bgImageStyle={{
                        height:"800px",
                        width:"100%"
                        }} 
                    strength={500} 
                    >
                        <div className="parallaxSize">
                            <div className="inside">

                            </div>
                        </div>
               </Parallax>
               <Parallax 
                    bgImage={image3} 
                    bgImageStyle={{
                        height:"800px",
                        width:"100%"
                        }} 
                    strength={500} 
                    >
                        <div className="parallaxSize">
                            <div className="inside">

                            </div>
                        </div>
               </Parallax>
               <Parallax 
                    bgImage={image4} 
                    bgImageStyle={{
                        height:"800px",
                        width:"100%"
                        }} 
                    strength={500} 
                    >
                        <div className="parallaxSize">
                            <div className="inside">

                            </div>
                        </div>
               </Parallax>
               <Parallax 
                    bgImage={image5} 
                    bgImageStyle={{
                        height:"800px",
                        width:"100%"
                        }} 
                    strength={500} 
                    >
                        <div className="parallaxSize">
                            <div className="inside">

                            </div>
                        </div>
               </Parallax>
               </div>    
           </div>
        )
    }   
}


export default HomePage;
